te-param-reason','s:84:\"Reason for the deletion. If not set, an automatically generated reason will be used.\";'),('en','messages:apihelp-delete-param-tags','s:54:\"Change tags to apply to the entry in the deletion log.\";'),('en','messages:apihelp-delete-param-title','s:78:\"Title of the page to delete. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-delete-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-delete-summary','s:14:\"Delete a page.\";'),('en','messages:apihelp-disabled-summary','s:30:\"This module has been disabled.\";'),('en','messages:apihelp-edit-example-edit','s:12:\"Edit a page.\";'),('en','messages:apihelp-edit-example-prepend','s:47:\"Prepend <kbd>_&#95;NOTOC_&#95;</kbd> to a page.\";'),('en','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('en','messages:apihelp-edit-param-appendtext','s:127:\"Add this text to the end of the page. Overrides $1text.\n\nUse $1section=new to append a new section, rather than this parameter.\";'),('en','messages:apihelp-edit-param-basetimestamp','s:168:\"Timestamp of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('en','messages:apihelp-edit-param-bot','s:29:\"Mark this edit as a bot edit.\";'),('en','messages:apihelp-edit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-edit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-edit-param-createonly','s:41:\"Don\'t edit the page if it exist