prop','s:24:\"Which properties to get.\";'),('en','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-summary','s:31:\"Return messages from this site.\";'),('en','messages:apihelp-query+allpages-example-B','s:57:\"Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:60:\"Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:70:\"Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allpages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:108:\"Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-prexpiry','s:223:\"Which protection expiry to filter the page on:\n;indefinite:Get only pages with indefinite protection expiry.\n;definite:G