ision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:41:\"Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:27:\"Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:37:\"List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-summary','s:23:\"List deleted revisions.\";'),('en','messages:apihelp-query+disabled-summary','s:36:\"This query module has been disabled.\";'),('en','messages:apihelp-query+duplicatefiles-example-generated','s:33:\"Look for duplicates of all files.\";'),('en','messages:apihelp-query+duplicatefiles-example-simple','s:58:\"Look for duplicates of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+duplicatefiles-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+duplicatefiles-param-limit','s:35:\"How many duplicate files to return.\";'),('en','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+duplicatefiles-summary','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('en','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('en','messages:apihelp-query+embeddedin-param-dir