ery+mystashedfiles-paramvalue-prop-size','s:41:\"Fetch the file size and image dimensions.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:42:\"Fetch the file\'s MIME type and media type.\";'),('en','messages:apihelp-query+mystashedfiles-summary','s:55:\"Get a list of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-summary','s:48:\"List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:215:\"Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('en','messages:apihelp-query+pageprops-summary','s:56:\"Get various page properties defined in the page content.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:163:\"Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepro