g back in, and check that your browser allows cookies from this site.\";'),('en','messages:expand_templates_preview_fail_html_anon','s:253:\"<em>Because {{SITENAME}} has raw HTML enabled and you are not logged in, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please [[Special:UserLogin|log in]] and try again.</strong>\";'),('en','messages:expand_templates_remove_comments','s:15:\"Remove comments\";'),('en','messages:expand_templates_remove_nowiki','s:32:\"Suppress <nowiki> tags in result\";'),('en','messages:expand_templates_title','s:42:\"Context title, for {{FULLPAGENAME}}, etc.:\";'),('en','messages:expand_templates_xml_output','s:10:\"XML output\";'),('en','messages:expandtemplates','s:16:\"Expand templates\";'),('en','messages:expansion-depth-exceeded-category','s:39:\"Pages where expansion depth is exceeded\";'),('en','messages:expansion-depth-exceeded-category-desc','s:45:\"The page exceeds the maximum expansion depth.\";'),('en','messages:expansion-depth-exceeded-warning','s:33:\"Page exceeded the expansion depth\";'),('en','messages:expensive-parserfunction-category','s:51:\"Pages with too many expensive parser function calls\";'),('en','messages:expensive-parserfunction-category-desc','s:214:\"The page uses too many expensive parser functions (like <code>#ifexist</code>). See [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Manual:$wgExpensiveParserFunctionLimit].\";'),('en','messages:expensive-parserfunction-warning','s:194:\"<strong>Warning:</strong> This page contains too many expensive parser function calls.\n\nIt should have less than $2 {{PLURAL:$2|call|calls}}, there {{PLURAL:$1|is now $1 call|are now $1 calls}}.\";'),('en','messages:expiringblock','s:19:\"expires on $1 at $2\";'),('en','messages:explainconflict','s:327:\"Someone else has changed this page since you started editing it.\nThe upper text area contains the page text as i