INSERT INTO `text` VALUES (1,'<strong>MediaWiki has been installed.</strong>\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]','utf-8'),(2,'== <strong>This is AHM MediaWiki.</strong> ==\n\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software\n\n== \'\'\'Documents\'\'\' ==\n* [[Docker Installation and Configuration]]\n* [[LAMP Server ]]\n* [[Quest Commands & Help]]\n* [[Secure-Delete (srm)]]\n\n== \'\'\'Videos\'\'\' ==\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:0px;top:218px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n{{#widget: Youtube|width=250px|height=250px|id=9guvwsh-ewU}}\n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Combating the Opioid Epidemic with Evidence-based Analytics\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:380px;top:95px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n{{#widget: Youtube|width=250px|height=250px|id=qJIl2XFCJvk}}\n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Webinar Engage Members through Data and Analytics\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:-380px;top:-30px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n{{#widget: Youtube|width=250px|height=250px|id=2SnvR3qsDuE}} \n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'ActiveHealth PCMH Practice Support Pilot with NC State Health Plan\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n\n== \'\'\'Tools\'\'\' ==\n* To Create a Page Enter page name & Click on Create Page button.\n\n\n<inputbox>\ntype=create\nbreak=no\n</inputbox>','utf-8'),(3,'\n== Docker-ce Installation and Configuration ==\n\n\n\'\'\'1] Configure proxy in yum.conf for adding Docker repo.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nAdd below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:1.png]]\n \n\'\'\'2] Enable rhel-extras repo & Add docker repo\'\'\'\n\n\'\'# yum-config-manager --enable rhel-7-server-extras-rpms\'\'\n[[File:2.png]]\n\n\'\'# yum-config-manager     --add-repo     https://download.docker.com/linux/centos/docker-ce.repo\'\'\n[[File:3.png]]\n\n\n\'\'\'3] Remove proxy from yum.conf.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nRemove below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:4.png]]\n\n\n\'\'\'4] Configure proxy for just docker repo\'\'\'\n\n\'\'# vi /etc/yum.repos.d/docker-ce.repo\'\'\n\nAdd these 2 lines after every \"gpgkey=\" line.\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:5.png]]\n \n\n\'\'\'5] Installation of docker and start it, Enable it after installation.\'\'\'\n\n\'\'# yum install docker-ce y\'\'\n\n[[File:6.png]]\n \n\'\'# systemctl start docker;systemctl enable docker\'\'\n\n[[File:7.png]]\n \n\n\'\'\'6] If docker is running we will get output for docker ps command. (Docker requires root access).\'\'\'\n\n\'\'# docker ps\'\'\n\n[[File:8.png]]\n \n\n\'\'\'7] Configure docker\'s proxy so that docker can connect to docker hub.\'\'\'\n\nCreate http-proxy.conf file and enter following lines:\n\n\'\'[Service]\'\'\n\n\'\'Environment=\"HTTP_PROXY=http://proxypdc.ahm.corp:9119/\"\'\'\n\n\'\'# mkdir -p /etc/systemd/system/docker.service.d\'\'\n\n\'\'# vi /etc/systemd/system/docker.service.d/http-proxy.conf\'\'\n\n[[File:9.png]]\n \n\n\'\'\'8] Reload deamon & restart docker service\'\'\'\n\n\'\'# systemctl daemon-reload\'\'\n\n\'\'# systemctl restart docker\'\'\n\n[[File:10.png]]\n \n\n\'\'\'9] Check if you can connect to docker hub.\'\'\'\n\n\'\'# docker search Ubuntu\'\'\n\n[[File:11.png]]\n \n\n\'\'\'10] Add user to docker group so that user can run docker commands without switching to root.\'\'\'\n\n\'\'# usermod -aG docker $username\'\'\n\n\'\'# su $username\'\'\n\n\'\'$ docker ps\'\'\n\n[[File:12.png]]\n\n----','utf-8'),(4,'','utf-8'),(5,'','utf-8'),(6,'','utf-8'),(7,'','utf-8'),(8,'','utf-8'),(9,'','utf-8'),(10,'','utf-8'),(11,'','utf-8'),(12,'','utf-8'),(13,'','utf-8'),(14,'','utf-8'),(15,'','utf-8'),(16,'\n== Docker-ce Installation and Configuration ==\n\n\n\'\'\'1] Configure proxy in yum.conf for adding Docker repo.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nAdd below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n\n \n\'\'\'2] Enable rhel-extras repo & Add docker repo\'\'\'\n\n\'\'# yum-config-manager --enable rhel-7-server-extras-rpms\'\'\n[[File:2.png]]\n\n\'\'# yum-config-manager     --add-repo     https://download.docker.com/linux/centos/docker-ce.repo\'\'\n[[File:3.png]]\n\n\n\'\'\'3] Remove proxy from yum.conf.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nRemove below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:4.png]]\n\n\n\'\'\'4] Configure proxy for just docker repo\'\'\'\n\n\'\'# vi /etc/yum.repos.d/docker-ce.repo\'\'\n\nAdd these 2 lines after every \"gpgkey=\" line.\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:5.png]]\n \n\n\'\'\'5] Installation of docker and start it, Enable it after installation.\'\'\'\n\n\'\'# yum install docker-ce y\'\'\n\n[[File:6.png]]\n \n\'\'# systemctl start docker;systemctl enable docker\'\'\n\n[[File:7.png]]\n \n\n\'\'\'6] If docker is running we will get output for docker ps command. (Docker requires root access).\'\'\'\n\n\'\'# docker ps\'\'\n\n[[File:8.png]]\n \n\n\'\'\'7] Configure docker\'s proxy so that docker can connect to docker hub.\'\'\'\n\nCreate http-proxy.conf file and enter following lines:\n\n\'\'[Service]\'\'\n\n\'\'Environment=\"HTTP_PROXY=http://proxypdc.ahm.corp:9119/\"\'\'\n\n\'\'# mkdir -p /etc/systemd/system/docker.service.d\'\'\n\n\'\'# vi /etc/systemd/system/docker.service.d/http-proxy.conf\'\'\n\n[[File:9.png]]\n \n\n\'\'\'8] Reload deamon & restart docker service\'\'\'\n\n\'\'# systemctl daemon-reload\'\'\n\n\'\'# systemctl restart docker\'\'\n\n[[File:10.png]]\n \n\n\'\'\'9] Check if you can connect to docker hub.\'\'\'\n\n\'\'# docker search Ubuntu\'\'\n\n[[File:11.png]]\n \n\n\'\'\'10] Add user to docker group so that user can run docker commands without switching to root.\'\'\'\n\n\'\'# usermod -aG docker $username\'\'\n\n\'\'# su $username\'\'\n\n\'\'$ docker ps\'\'\n\n[[File:12.png]]\n\n----','utf-8'),(17,'\n== Docker-ce Installation and Configuration ==\n\n\n\'\'\'1] Configure proxy in yum.conf for adding Docker repo.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nAdd below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:1.png]]\n \n\'\'\'2] Enable rhel-extras repo & Add docker repo\'\'\'\n\n\'\'# yum-config-manager --enable rhel-7-server-extras-rpms\'\'\n[[File:2.png]]\n\n\'\'# yum-config-manager     --add-repo     https://download.docker.com/linux/centos/docker-ce.repo\'\'\n[[File:3.png]]\n\n\n\'\'\'3] Remove proxy from yum.conf.\'\'\'\n\n\'\'# vi /etc/yum.conf\'\'\n\nRemove below 2 lines:\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:4.png]]\n\n\n\'\'\'4] Configure proxy for just docker repo\'\'\'\n\n\'\'# vi /etc/yum.repos.d/docker-ce.repo\'\'\n\nAdd these 2 lines after every \"gpgkey=\" line.\n\n\'\'proxy=https://proxypdc.ahm.corp:9119\'\'\n\n\'\'proxy=http://proxypdc.ahm.corp:9119\'\'\n\n[[File:5.png]]\n \n\n\'\'\'5] Installation of docker and start it, Enable it after installation.\'\'\'\n\n\'\'# yum install docker-ce y\'\'\n\n[[File:6.png]]\n \n\'\'# systemctl start docker;systemctl enable docker\'\'\n\n[[File:7.png]]\n \n\n\'\'\'6] If docker is running we will get output for docker ps command. (Docker requires root access).\'\'\'\n\n\'\'# docker ps\'\'\n\n[[File:8.png]]\n \n\n\'\'\'7] Configure docker\'s proxy so that docker can connect to docker hub.\'\'\'\n\nCreate http-proxy.conf file and enter following lines:\n\n\'\'[Service]\'\'\n\n\'\'Environment=\"HTTP_PROXY=http://proxypdc.ahm.corp:9119/\"\'\'\n\n\'\'# mkdir -p /etc/systemd/system/docker.service.d\'\'\n\n\'\'# vi /etc/systemd/system/docker.service.d/http-proxy.conf\'\'\n\n[[File:9.png]]\n \n\n\'\'\'8] Reload deamon & restart docker service\'\'\'\n\n\'\'# systemctl daemon-reload\'\'\n\n\'\'# systemctl restart docker\'\'\n\n[[File:10.png]]\n \n\n\'\'\'9] Check if you can connect to docker hub.\'\'\'\n\n\'\'# docker search Ubuntu\'\'\n\n[[File:11.png]]\n \n\n\'\'\'10] Add user to docker group so that user can run docker commands without switching to root.\'\'\'\n\n\'\'# usermod -aG docker $username\'\'\n\n\'\'# su $username\'\'\n\n\'\'$ docker ps\'\'\n\n[[File:12.png]]\n\n----','utf-8'),(18,'\n== LAMP Configuration Steps ==\n\n\'\'\'Necessary Modules\'\'\'\n\n<nowiki># httpd - Base Apache</nowiki>\n\n<nowiki># mod_ssl & openssl - Needed for HTTPS/SSL secure websites</nowiki>\n\n<nowiki># mariadb-server & mariadb - MariaDB Database (latest DB based on MySQL after Oracle bought MySQL)</nowiki>\n\n<nowiki># php - Base PHP</nowiki>\n\n<nowiki># php-mysql - Allow PHP to work with MariaDB/MySQL</nowiki>\n\n<nowiki># php-gd - Allow PHP to create/manipulate images</nowiki>\n\n<nowiki># php-mbstring - Allow PHP to work with multi-byte strings - </nowiki>[http://php.net/manual/en/book.mbstring.php http://php.net/manual/en/book.mbstring.p][http://php.net/manual/en/book.mbstring.php hp]\n\n\n\'\'\'1] yum install -y httpd mod_ssl openssl mariadb-server mariadb php php-mysql php-gd php-mbstring\'\'\'\n\n<nowiki># Create simple PHP Info page to verify PHP is working in Apache</nowiki>\n\n\'\'sudo echo \"\" | sudo tee /var/www/html/info.php\'\'\n\n\n\'\'<nowiki>echo \"<?PHP</nowiki>\'\'\n\n\'\'<nowiki>echo \'Server URL: \' . \\$_SERVER[\'SERVER_NAME\'] . \'</nowiki>\'\'\n\n\'\'<nowiki>Document Root: \' . \\$_SERVER[\'DOCUMENT_ROOT\'];</nowiki>\'\'\n\n\'\'?>\" | sudo tee /var/www/html/index.php\'\'\n\n\'\'\'2] Backup original apache config file :\'\'\'\n\n\'\'sudo cp /etc/httpd/conf/httpd.conf /etc/httpd/conf/httpd.conf.bkp\'\'\n\n\'\'\'3] Configure httpd.conf to handle PHP page.\'\'\'\n\n\'\'<nowiki>sudo sed -i -e \'s/^[ \\t]*//\' /etc/httpd/conf/httpd.conf</nowiki>\'\'\n\n\'\'sudo sed -i \"s|IncludeOptional|#IncludeOptional|\" /etc/httpd/conf/httpd.conf\'\'\n\n\'\'sudo sed -i \"s|#ServerName \'\'[http://www.example.com:80|ServerName/ www.example.com:80|ServerName]\'\' localhost|\" /etc/httpd/conf/httpd.conf\'\'\n\n\'\'sudo sed -i \"s|DirectoryIndex index.html|DirectoryIndex index.html index.php|\" /etc/httpd/conf/httpd.conf\'\'\n\n\n<nowiki># Add PHP configuration into Apache</nowiki>\n\n\'\'echo \"AddType application/x-httpd-php .php\" | sudo tee -a /etc/httpd/conf/httpd.conf\'\'\n\n\'\'\'4]Start MariaDB service & start MariaDB secure installation:\'\'\'\n\n\'\'systemctl start mariadb.service\'\'\n\n\'\'/usr/bin/mysql_secure_installation\'\'\n\n\'\'$ sudo /usr/bin/mysql_secure_installation\'\'\n\n\nNOTE: RUNNING ALL PARTS OF THIS SCRIPT IS RECOMMENDED FOR ALL MariaDB\n\nSERVERS IN PRODUCTION USE! PLEASE READ EACH STEP CAREFULLY!\n\n\nIn order to log into MariaDB to secure it, we\'ll need the current\n\npassword for the root user. If you\'ve just installed MariaDB, and\n\nyou haven\'t set the root password yet, the password will be blank,\n\nso you should just press enter here.\n\n\nEnter current password for root (enter for none):\n\n* \'\'\'At this point, tap enter/return, as you shouldnt have a root password at this point\'\'\'\n\nEnter current password for root (enter for none): \n\nOK, successfully used password, moving on...\n\n\nSetting the root password ensures that nobody can log into the MariaDB\n\nroot user without the proper authorisation.\n\n\n\'\'<nowiki>Set root password? [Y/n]</nowiki>\'\'\n\n\'\'<nowiki>Set root password? [Y/n] y</nowiki>\'\'\n\n\'\'New password: \'\'\n\n\'\'Re-enter new password: \'\'\n\nPassword updated successfully!\n\n\'\'\'Password used is : l@pt0p\'\'\'\n\n\nReloading privilege tables..\n\n... Success!\n\n\nBy default, a MariaDB installation has an anonymous user, allowing anyone\n\nto log into MariaDB without having to have a user account created for\n\nthem. This is intended only for testing, and to make the installation\n\ngo a bit smoother. You should remove them before moving into a\n\nproduction environment.\n\n\n\'\'<nowiki>Remove anonymous users? [Y/n]</nowiki>\'\'\n\n\'\'<nowiki>Remove anonymous users? [Y/n] y</nowiki>\'\'\n\n\'\'... Success!\'\'\n\n\nNormally, root should only be allowed to connect from \'localhost\'. This\n\nensures that someone cannot guess at the root password from the network.\n\n\n\'\'<nowiki>Disallow root login remotely? [Y/n]</nowiki>\'\'\n\n\'\'<nowiki>Disallow root login remotely? [Y/n] y</nowiki>\'\'\n\n\'\'... Success!\'\'\n\n\nBy default, MariaDB comes with a database named \'test\' that anyone can\n\naccess. This is also intended only for testing, and should be removed\n\nbefore moving into a production environment.\n\n\n\'\'<nowiki>Remove test database and access to it? [Y/n]</nowiki>\'\'\n\n\'\'<nowiki>Remove test database and access to it? [Y/n] y</nowiki>\'\'\n\n\'\'- Dropping test database...\'\'\n\n\'\'... Success!\'\'\n\n\'\'- Removing privileges on test database...\'\'\n\n\'\'... Success!\'\'\n\n\nReloading the privilege tables will ensure that all changes made so far\n\nwill take effect immediately.\n\n\n\'\'<nowiki>Reload privilege tables now? [Y/n]</nowiki>\'\'\n\n\'\'<nowiki>Reload privilege tables now? [Y/n] y</nowiki>\'\'\n\n\'\'... Success!\'\'\n\n\nCleaning up...\n\n\nAll done! If you\'ve completed all of the above steps, your MariaDB\n\ninstallation should now be secure.\n\n\nThanks for using MariaDB!\n\n\'\'\'5] start Apache service & Check webpage.\'\'\'\n\n\'\'systemctl start httpd.service\'\'','utf-8'),(19,'\n== Vastool Commands ==\n\n\n\'\'\'<nowiki>#to Check status of quest</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool status\'\'\n\n\n\'\'\'<nowiki>#to restart vasd service</nowiki>\'\'\'\n\n\'\'service vasd status/start/stop\'\'\n\n\n\'\'\'<nowiki>#lists groups that are granted access to the server</nowiki>\'\'\'\n\n\'\'cat /etc/opt/quest/vas/users.allow\'\'\n\n\n\'\'\'<nowiki>#Vastool command to list Unix machine objects from a specified OU</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool list users-allowed\'\'\n\n\n\'\'\'<nowiki>#vastool flush goes out to Active Directory and reloads the cache. It caches information about the Active directory envinorment such as schema, site, domain controllers, global catalogs, along with users and groups</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool flush\'\'\n\n\n\'\'\'<nowiki>#In this command we are specified the type of OS, in the example I have to see only the Linux machines in the OU Unix Machines & removing server from domain.</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u svcunixop -w G00dHe@lth join -f -c OU=AZNP,OU=Servers,OU=Unix,DC=ahm,DC=corp ahm.corp\'\'\n\n\n\'\'\'<nowiki>#Run preflight script to ensure no ports are being blocked</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/preflight ahm.corp\'\'\n\n\n\'\'\'<nowiki>#reset the QAS host objects password in AD</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u svcunixop passwd -rk /etc/opt/quest/vas/host.keytab host/\'\'\n\n\n\'\'\'<nowiki>#Rejoin the server to AD</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u svcunixop join -f ahm.corp\'\'\n\n\n\'\'\'<nowiki>#List specific user in AD</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u host/ list -la users | grep -i \"USERID\"\'\'\n\n\n\'\'\'<nowiki>#Test AD connection and user password</nowiki>\'\'\'\n\n\'\'<nowiki>/opt/quest/bin/vastool kinit <username_who_cannot_login></nowiki>\'\'\n\n\n\'\'\'<nowiki>#Test VAS host access control</nowiki>\'\'\'\n\n\'\'<nowiki>/opt/quest/bin/vastool user checkaccess <username_who_cannot_login></nowiki>\'\'\n\n\n\'\'\'<nowiki>#Test VAS service access control (assuming your using sshd)</nowiki>\'\'\'\n\n\'\'<nowiki>/opt/quest/bin/vastool user checkaccess -s sshd <username_who_cannot_login></nowiki>\'\'\n\n\n\'\'\'<nowiki>#list all users in specific group</nowiki>\'\'\'\n\n\'\'<nowiki>getent group <GROUPNAME></nowiki>\'\'\n\n\n\'\'\'<nowiki>#Add specific user in specif AD group</nowiki>\'\'\'\n\n\'\'<nowiki>/opt/quest/bin/vastool -u svcunixop group <GROUPNAME> add <USERNAME></nowiki>\'\'\n\n\n\'\'\'<nowiki>#Delete specific user from specific AD group</nowiki>\'\'\'\n\n\'\'<nowiki>/opt/quest/bin/vastool -u svcunixop group <GROUPNAME> del <USERNAME></nowiki>\'\'\n\n\n\'\'\'<nowiki>#Create new user in AD</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u svcunixop create -i \"USERID:x:1001:1000:COMMENT:/home/USERID:/bin/bash\" user USERID\'\'\n\n\n\'\'\'<nowiki>#Enable/Disable user</nowiki>\'\'\'\n\n\'\'/opt/quest/bin/vastool -u svcunixop user enable/disable USERID\'\'','utf-8'),(20,'\'\'\'Secure-Delete(srm)\'\'\'\n\nSecure-Delete is a set of tools for Linux operating system and they provide advanced techniques for permanent removal of files.&nbsp; Once Secure-Delete has been installed on any Linux system, it provides following four commands:\n\n \'\'\'\'\'srm\'\'\'\'\'\n\n \'\'\'\'\'smem\'\'\'\'\'\n\n \'\'\'\'\'sfill\'\'\'\'\'\n\n \'\'\'\'\'sswap\'\'\'\'\'\n\n\n\'\'\'srm\'\'\'\n\nsrm command works similarly to rm command, but instead of just deleting the file, it first overwrites it multiple times with some random data and then removes the file permanently. The syntax for this command is pretty simple, just specify the file or directory to remove and it will take care of the task.\n\n&nbsp;\n\n$\'\'srm&nbsp; /home/eddie/Documents/file.jpg\'\'\n\n&nbsp;\n\n\'\'\'Wipe\'\'\'\n\n&nbsp;\n\nThis command line utility writes special patterns to the files repeatedly. It uses fsync() call and/or the O_SYNC bit to force \n\ndisk access. It uses Gutmann algorithm for repeated writes. You can remove contents of single file, folder or entire hard disk \n\nwith this command, but whole hard disk format using wipe command will take good amount of time. The installation and use of this \n\nutility is pretty easy.\n\n&nbsp;\n\nSecurely remove your tmp partition by running following command:\n\n$\'\'wipe -r /tmp\'\'\n\n&nbsp;\n\nUse following command to remove contents&nbsp; of complete partition (replace partition name with your desired partition).\n\n$\'\'wipe /dev/sda1\'\'\n\n&nbsp;\n\nSecurely delete specific file\n\n$\'\'wipe /home/eddie/Documents/file.jpg\'\'\n\n&nbsp;\n\n&nbsp;\n\nBoth of these tools are available in the epel repository for RHEL6 and 7','utf-8'),(21,'== <strong>This is AHM MediaWiki.</strong> ==\n\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software\n\n== \'\'\'Documents\'\'\' ==\n* [[Docker Installation and Configuration]]\n* [[LAMP Server ]]\n* [[Quest Commands & Help]]\n* [[Secure-Delete (srm)]]\n\n== \'\'\'Videos\'\'\' ==\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:0px;top:218px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n{{#widget: Youtube|width=250px|height=250px|id=9guvwsh-ewU}}\n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Combating the Opioid Epidemic with Evidence-based Analytics\'\'\'</font size>\n<br/>\n\n</