n<youtube width=\"250\" height=\"250\">2SnvR3qsDuE</youtube>     \n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'ActiveHealth PCMH Practice Support Pilot with NC State Health Plan\'\'\'</font size>\n<br/>\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:380px;top:95px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n<youtube width=\"250\" height=\"250\">9guvwsh-ewU</youtube>\n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Combating the Opioid Epidemic with Evidence-based Analytics\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:-380px;top:-30px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n\n<youtube width=\"250\" height=\"250\">qJIl2XFCJvk</youtube>\n\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Webinar Engage Members through Data and Analytics\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n== \'\'\'Tools\'\'\' ==\n* To Create a Page Enter page name & Click on Create Page button.\n\n\n<inputbox>\ntype=create\nbreak=no\n</inputbox>','utf-8'),(32,'This Web Privacy Statement applies to the ActiveHealth Website. Any use of this site constitutes your agreement to this Web Privacy Statement.\n\n\n== \'\'\'Collecting and Using Personal Information\'\'\' ==\n\nWhen you visit and navigate our Website and when you communicate with us via our Website, we will not collect personal information about you unless you provide us that information voluntarily. Any non-public personal information that you may provide via our Website may be used to verify you identity so that we can be sure that all of our communications with you are secure and confidential, and respond to inquiries or requests from you. (In some cases, and in all cases where required by law or regulation, you will be able to update the information that you provide to us either by sending us an e-mail or, where you have established personal profiles with us, by updating your profile online. Please refer to the specific pages where data is collected for more information.) Except in connection with the sale, transfer, merger, consolidation or other transaction involving all or a part of our company, ActiveHealth will not sell, license, transmit or disclose this information outside of ActiveHealth and its affiliated companies unless (a) expressly authorized by you, (b) necessary to enable ActiveHealth contractors or agents to perform certain functions for us, or (c) required or permitted by law. In all cases, we will disclose the information consistent with applicable laws and regulations and we will require the recipient to protect the information and use it only for the purpose it was provided. By \"personal information,\" we mean data that is unique to an individual, such as a name, address, Social Security number, or telephone number. From time to time, we may request personal information from you at our Website in order to deliver products, services or requested materials to you or respond to your questions.\n\nThis website is not directed to and we will not knowingly collect personally-identifiable information from minors under the age of thirteen (13) without their parents consent.\n\nActiveHealth does not serve advertising on this website. We do not engage online advertising service providers to serve ads on other sites, based on web pages you may have visited or your search engine activity. For this reason, it is not necessary for us to respond to Do Not Track signals.\n\n\n== \'\'\'Your E-Mail\'\'\' ==\n\nWe welcome your comments or questions about our Website and have provided e-mail boxes for that purpose. We will share your comments and questions with our customer service representatives and those employees most capable of addressing your questions and concerns.\n\nPlease note that your e-mail, like most, if not all, non-encrypted Internet e-mail communications, may be accessed and viewed by other Internet users, without your knowledge and permission, while in transit to us. For that reason, to protect your privacy, please do not use e-mail to communicate information to us that you consider confidential. If you wish, you may contact us instead via non-cellular telephone at the numbers provided at various locations on our Website.\n\n\n== \'\'\'Collecting and using non-personally identifiable information\'\'\' ==\n\nYou should also be aware that when you visit our website, we collect certain non-personally-identifiable and aggregate information about you. This data helps us to analyze and improve the usefulness of the information we provide at this website. In order for you to make an informed decision about whether to use and navigate our website, we are providing you with the following information about how we collect and use non-personally identifiable and aggregate information. By non-personally-identifiable information, we mean information that does not identify you personally, but provides us with anonymous \"usage data,\" such as the number of unique visitors we receive, what pages are visited most often and the navigation preferences and characteristics of our visitors.\n\nWeb browser information. Web browsers collect and store information about the type of device and operating system you are using to access our website, as well as your devices MAC address for facilitating network communications. Accessing this information helps us to establish a secure and consistent connection to you during your visits to our website.\n\n\"Cookie\" technology. A \"cookie\" is an element of data that a website can send to your browser when you link to that website. It is not a computer program and has no ability to read data residing on your computer or instruct it to perform any step or function. By assigning a unique data element to each visitor, the website is able to recognize repeat users, track usage patterns and better serve you when you return to that site. The cookie does not extract other personal information about you, such as your name or address.\n\nClient-side page tagging. This technology uses code on each web page to write certain information about the page and the visitor to a log when a page is rendered to you by your web browser. \"Tagging\" does result in a JavaScript program running in your browser, but it is limited to providing information about the page that you are requesting and the configuration of your browser. It will not read any of your data files, nor execute any additional programs. It does not extract any personal information about you, such as your name or email address. You can prevent tagging by disabling JavaScript in your browser, but that may prevent you from using all of our website\'s functions.\n\nTracking pixels or beacons. These techniques use electronic files to track your navigation of our website, your completion of transactions and other browsing behavior.\n\nIP Address: When you subscribe to an Internet Service Provider (ISP), your computing device is assigned an IP Address. We track and store this address to help us manage security and monitor usage volume and patterns.\n\n\n== \'\'\'Linking to Other Sites\'\'\' ==\n\nFrom time to time, our Website may provide links to other websites, not owned or controlled by ActiveHealth, that we think might be useful or of interest to you. We cannot, however, be responsible for the privacy practices used by other website owners or the content or accuracy of those other websites. Links to various non-ActiveHealth websites do not constitute or imply endorsement by ActiveHealth of these websites, any products or services described on these sites, or of any other material contained in them.\n\n\n== \'\'\'Security\'\'\' ==\n\nActiveHealth has adopted and adheres to stringent security standards designed to protect non-public personal information at activehealth.net against accidental or unauthorized access or disclosure. Among the safeguards that ActiveHealth has developed for this site are administrative, physical and technical barriers that together protect this web site and our other internal systems from unauthorized access or use. We periodically subject our site to simulated intrusion tests and have developed comprehensive disaster recovery plans.\n\n\n== \'\'\'Changes to This Statement\'\'\' ==\n\nActiveHealth may change this Privacy Policy from time to time. We encourage you to periodically reread this Policy to see if there have been any changes that may affect you. This Privacy Policy is not intended to and does not create any contractual or other legal rights in or on behalf of any party.','utf-8'),(33,'\n== \'\'\'Company\'\'\' ==\n\n\nActiveHealth Management is a subsidiary to the Aetna company, that\'s working to transform healthcare for patients, providers and employers.\n\n\n\n== \'\'\'ActiveHealth Management Clinical Development Center\'\'\' ==\n\n\nHealthcare standards are constantly evolving and best practices in medicine change quickly over time, so the ActiveHealth Clinical Development Center was created to maintain our evidence-based rules, algorithms and matrices. This group of full-time, board-certified physicians, pharmacists and registered nurses continually monitor peer-reviewed journals and medical texts and maintain outreach to specialists in the field to find sources for academic and clinical breakthroughs Reference: The Clinical Development Center also collaborates with physicians on the Harvard Medical School (HMS) faculty to review and approve the content in our library of more than 1,400 Care Considerations.\n\n\n\n== \'\'\'ActiveHealth Accreditations\'\'\' ==\n\nURAC module: ActiveHealth has been fully accredited by URAC in health utilization management since 1992. (Visit the URAC Website to learn more)\n\nNCQA module: ActiveHealth holds full NCQA accreditation for our Disease Management and Case Management programs and Wellness & Health Promotion Accreditation with Performance Reporting. (Visit the NCQA website to learn more)\n\n\n                                                          \'\'\'ActiveHealth Careers\'\'\' \n\n\nAt ActiveHealth, we are passionate about improving quality of care, reducing costs and transforming lives. Whether you are a registered nurse, board certified doctor skilled product manager or simply interested in working to help people live healthier lives, we have a career opportunity for you. As an independent subsidiary of Aetna, one of the world\'s largest health insurance companies, our career opportunities are greater than ever.\n\nVisit the Aetna Careers website to view current openings and share your resume with us.','utf-8'),(34,'== <strong>This is Infy MediaWiki.</strong> ==\n\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software\n\n== \'\'\'Documents\'\'\' ==\n* [[Docker Installation and Configuration]]\n* [[LAMP Server ]]\n* [[Quest Commands & Help]]\n* [[Secure-Delete (srm)]]\n\n== \'\'\'Videos\'\'\' ==\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:0px;top:218px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n<youtube width=\"250\" height=\"250\">vSGpiobkbkc</youtube>     \n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Infosys Q3 FY19 Results - Press Conference\'\'\'</font size>\n<br/>\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:380px;top:95px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n<youtube width=\"250\" height=\"250\">iRMIaF5vny0</youtube>\n<br/>\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Infosys at GovHack 2018\'\'\'</font size>\n<br/>\n\n</div></div></div>\n\n<div style=\"margin:-200px auto 24px;\n    position:relative;left:-380px;top:-30px;width:300px;height:300px\n\">\n<div class=\"thumbinner\">\n\n<youtube width=\"250\" height=\"250\">HH-tfW1TFjM</youtube>\n\n<div class=\"thumbcaption\"><font size=\"2\">\'\'\'Infosys Inaugurate